* un train roulant à des vitesses supérieures à 250 km/h sur des lignes spécialisées ; 
* un train roulant à environ 200 km/h sur des lignes standards adaptées ; 
* un train pouvant rouler à des vitesses inférieures en raison de conditions particulières de relief, de contraintes topographiques ou en environnement urbain. En France, dans les projets d'infrastructure ferroviaire, on parle plutôt de TAGV (Trains aptes à la grande vitesse) dans le but de respecter les règles européennes d'ouverture à la concurrence. La grande vitesse ferroviaire est née au Japon en 1964 avec le Shinkansen, puis s'est étendue dans plusieurs pays d'Europe et d'Asie. Elle a transformé le transport de voyageurs par trains et donné un nouvel élan à ce mode de transport. Cet article évoque également, à titre secondaire, les véhicules à sustentation magnétique, qui ne peuvent être définis comme des matériels ferroviaires puisqu'ils ne sont pas guidés par des rails, ne disposent pas de roues, et n'ont pas de contact avec leur infrastructure de guidage.
